import React, { useState } from 'react';
import Dropdown from './GridDropdown';
import { trainLogisticRegression } from './logisticRegression'; // Assuming you have a separate module for logistic regression

const MLdropdown = ({ data }) => {
  const options = [
    { label: 'Logistic Regression', value: 'option1' },
    { label: 'Naive Bayes', value: 'option2' },
    { label: 'Random forest', value: 'option3' },
    { label: 'Support Vector Machine', value: 'option4' },
    { label: 'Decision Tree', value: 'option5' },
  ];

  const [selectedOption, setSelectedOption] = useState('');
  const [accuracy, setAccuracy] = useState(null);

  const handleOptionSelect = (selectedValue) => {
    setSelectedOption(selectedValue);
    setAccuracy(null);
  };

  const handleLogisticRegression = () => {
    // Perform logistic regression using the `data`
    const trainingAccuracy = trainLogisticRegression(data); // Assuming trainLogisticRegression is a function that performs logistic regression and returns the training accuracy
    setAccuracy(trainingAccuracy);
  };

  return (
    <div>
      <h1>ML Model</h1>
      <Dropdown options={options} onSelect={handleOptionSelect} />
      {selectedOption === 'option1' && (
        <div>
          <button onClick={handleLogisticRegression}>Run Logistic Regression</button>
          {accuracy !== null && <p>Training Accuracy: {accuracy}</p>}
        </div>
      )}
    </div>
  );
};

export default MLdropdown;
